import React, {Component} from 'react';
import axios from 'axios';
class App extends Component {

    state = {
        todos: []
    }

    componentWillMount() {
        axios.get('https://jsonplaceholder.typicode.com/todos').then((response) => {
            this.setState({
                todos: response.data
            })
        });
    }

    render() {

        let books = this.state.books.map();

        return (

            <div className="App container">
                <table>
                    <thead>
                    <tr>
                        <th>ID</th>
                        <th>Title</th>
                        <th>Rating</th>
                        <th>Actions</th>
                    </tr>
                    </thead>
                    <tbody>
                    <tr>
                        <th>1</th>
                        <th>Book Title</th>
                        <th>2.5</th>
                        <th>
                            <button className="btn btn-default mr-1">Edit</button>

                            <button className="btn btn-danger">Delete</button>
                        </th>
                    </tr>
                    </tbody>
                </table>
            </div>
        )
            ;
    }
}

export default App;
